const list=document.querySelector("#list");var int=[];function execute(t){var n=new XMLHttpRequest;n.open("GET","http://127.0.0.1:3000/interaccion/"+t,!0),n.send(),ipcRenderer.send("int:start")}window.onload=function(){var t=new XMLHttpRequest;t.onreadystatechange=function(){if(4==this.readyState&&200==this.status){let n=JSON.parse(t.responseText),e="";for(let t=0;t<n.length;t++)e+=`<div id="int" class="col-md-6"><span class="btn btn-lg btn-warning btn-block" id="${n[t]._id}">${n[t].nombre}</span></div>`,t+1<n.length&&(t++,e+=`<div id="int" class="col-md-6"><span class="btn btn-lg btn-warning btn-block" id="${n[t]._id}">${n[t].nombre}</span></div>`),e+="<br/><br/><br/>";list.innerHTML=e,document.querySelectorAll("#int").forEach((t=>{t.addEventListener("click",(t=>{execute(t.target.id)}))}))}},t.open("GET","http://127.0.0.1:3000/api/common?db=interaccion",!0),t.send()};